        ans += cnt[k] * D[k] * 2
        for kk in range(k + 1, len(D)):
            if D[kk] % D[k] == 0:
                cnt[kk] -= cnt[k]
                cnt[kk] %= mod
    return ans % mod

def calculate_sum_of_operations(N: int, X: str) -> int:
    mod = 998244353
    rx = X.replace('1', '').replace('0', '1').replace('2', '0')
    D = []
    for i in range(1, int(N ** 0.5) + 1):
        if N % i == 0:
            if N // i % 2:
                D += [i]
            if i != N // i and i % 2:
                D += [N // i]
    D.sort()
    cnt = [0] * len(D)
    ans = 0
    for k in range(len(D)):
        t = X[:D[k]]
        rt = rx[:D[k]]
        f = (t + rt) * (N // D[k] // 2) + t
        cnt[k] = cnt[k] + int(f <= X) + int(t, 2)
        cnt[k] %= mod
        ans += cnt[k] * D[k] * 2
        for kk in range(k + 1, len(D)):
            if D[kk] % D[k] == 0:
                cnt[kk] -= cnt[k]
                cnt[kk] %= mod
    return ans % mod
